INSERT INTO `mantis_bug_text_table` VALUES (58,'Boa tarde\r\nPor gentileza, precisamos que os extratos da adquirente seja importado no Portal GTM, para que as transações sejam conciliadas corretamente e gere o CAR.\r\nAtt.','',''),(59,'Boa tarde\r\nPor gentileza, precisamos garantir o funcionamento dos relatórios financeiros para o fechamento, igual ocorre para Mooz Cartões:\r\n\r\nRelatórios:\r\nAdquirente Rede: Resumo Venda/ Pagamentos/ Ajuste Credito\r\nAdquirente Cielo (não transacionamos ainda, mas é bom verificar se os relatórios estão corretos: Resumo Operação\r\nICPT\r\nReceita Transações ICPT Em Aberto (novo)\r\nRelatório Receita Transações ICPT (novo)\r\n\r\nAtt','',''),(60,'Boa tarde\r\n\r\nApós adicionar os dados bancários, a tela na sequencia apresentou erro.\r\nPrecisamos que seja corrigido para não afetar outros clientes\r\n\r\nAtt','',''),(61,'Boa tarde\r\n\r\nPor gentileza, precisamos que corrigem a opção de lojas na tela do CP na visão admin\r\nO CP CP SILVA JUNIOR nem aparece a opção de logar, por exemplo.\r\nPoderiam verificar?\r\nAtt.','',''),(62,'Boa tarde\r\nPor gentileza, precisamos que  seja corrigido a opção de Exportar as transações no excel.\r\nQuando clicamos, o sistema não permite, deixando uma mensagem como Null.\r\nAtt.','',''),(63,'Boa tarde\r\nPor gentileza, incluir o código de ativação POS no Portal\r\nAtt.','',''),(64,'Boa tarde\r\nPor gentileza, precisamos que seja corrigido a agenda de recebíveis da franquia.\r\nEm anexo segue o print das telas.\r\nAtt.','',''),(65,'Boa tarde\r\nPrecisamos da correção na tela Visão Cliente - calendário de Recebíveis.\r\nNa tela não tem a opção do ano 2021 - tem somente até 2020.\r\nFavor verificar.\r\nAtt.\r\n','',''),(66,'Boa tarde\nConforme e-mail enviado pelo Roberto, estamos com uma frente no GTM e gostaria de entender o esforço necessário para ocultar o campo “valor da mensalidade” no portal para um determinado CP.\nPoderiam avaliar?\n\n','',''),(67,'Bom dia.\nPor gentileza, precisamos da correção na tela transações na visão do cliente.\nO campo Meio de Captura está aparecendo Todos, pois o cliente deseja filtrar somente o meio de captura POS.\nFavor verificar.\nAtt.','',''),(68,'Bom dia.\r\nPor gentileza, favor verificar o motivo do erro que ocorreu no Tombamento do POS.\r\nAo consultar o AGT, não localizamos o cadastro desses clientes.\r\nAtt.','',''),(69,'Bom dia\nPor gentileza, precisamos da correção da informação que fica disponível no relatório de Minhas Vendas, quando selecionamos um tipo de equipamento, por exemplo PTE ou TEF.\nA informação não atualiza por tipo de equipamento.\nSegue os prints em anexo.\nAtt.','',''),(70,'Bom dia\r\nPor gentileza, precisamos que seja corrigido o telefone de contato na Geração do Optin\r\nSegue o número certo 0800 744 2600.\r\nAtt.\r\n','',''),(71,'Bom dia.\nPor gentileza, precisamos entender e pedir a correção do agendamento/pagamento das transações em anexo.\nPelo que identificamos, mesmo com a Pré-conciliação, não foi criado o Lançamento CAP.\nAtt.','',''),(72,'Bom dia.\r\nPor gentileza, precisamos entender o motivo do pagamentos das transações abaixo (Segue alguns exemplo), estar previsto para o dia 29/07, porém a efetivação ficou para o dia 02/08/2021.\r\nPoderiam verificar o motivo?\r\n\r\nExemplo transações:\r\nhttps://gtm.coadqboticario.com.br/portal/transacao/show/18\r\nhttps://gtm.coadqboticario.com.br/portal/transacao/show/31\r\nhttps://gtm.coadqboticario.com.br/portal/transacao/show/24\r\n\r\nAtt.','',''),(73,'Boa tarde\r\nPrecisamos da correção com urgência das informações de Antecipação do CP 10002 Silva Junior do GTM, pois estão visualizando os recebíveis disponíveis para antecipação do CP 10002  ADHONAI de Mooz Cartões.\r\nSeguem o print abaixo.\r\nFavor corrigir com urgência.\r\nPrecisamos que os códigos dos CPs mesmo que se forem repetidos em Mooz Cartões/GTM não sejam confundidos,\r\nAtt.\r\n','',''),(74,'Boa tarde\nFavor precisamos que os relatórios personalizados sejam analisados, pois não estão abrindo. Ficam em processamento e não entregam a visão selecionada de cliente.\nSegue print.\natt','',''),(75,'Boa tarde\nFavor verificar o motivo das transações do cliente Drogarias Torres não ter aparecido no relatório de IPCT de Julho 2021.\nAtt.\n','',''),(76,'Boa tarde\r\nConforme repassado para Simone, por gentileza, poderiam verificar o que está ocorrendo na visão do cliente Daniel Feijó\r\nAo consultar Minhas Vendas, aparece uma tela de erro.\r\nAtt','',''),(77,'Boa tarde\nConforme arquivo anexo, há três campos que constam no menu de transações de Mooz Cartões e não constam no menu de GTM.\nPoderiam incluir?\nAtt.','',''),(78,'Boa tarde\r\nPor gentileza, precisamos entender se há algum problema no envio dos e-mails de Optin para os clientes.\r\nVários dos clientes GTM informaram que não receberam o e-mail convite de Optin, sendo necessário nós fazermos o cadastro por aqui.\r\nPrecisamos entender se há algum problema no e-mail hagana-adquirencia@grupoboticario.com.br e se seria possível alterar esse e-mail para algum endereço que remete a informação que refere-se ao GTM.\r\nÉ possível?\r\nAtt.','',''),(79,'Boa tarde\r\nIdentificamos alguns erros no envio dos e-mails automático (segue em anexo mais detalhes).\r\nAssunto: Credenciais de Acesso\r\nAo clicar no link informado para acesso no portal, ocorre erro. Mensagem:  \"Não é possível acessar esse site\"\r\n\r\nAssunto: Mooz Cartões - Aprovação de Adesão\r\nDireciona e-mail para o portal de Mooz Cartões e não GTM\r\nTem uma opção de Clique Aqui para consultar o manual, porém quando clica nessa opção consta a mensagem \"Not Found\".\r\nAtt.','',''),(80,'Bom dia.\r\nPor gentileza, precisamos disponibilizar as taxas  aplicadas de cada cliente em informações de reembolso, visão Cliente\r\nEssa informação fica localizada em:\r\n-  Informações da Conta\r\n- Informações de Reembolso\r\nNo print anexo segue exemplo de como está aparecendo para o cliente.\r\nAtt.','',''),(81,'Boa tarde\r\nFavor precisamos entender o motivo de não ter nenhum registro como Atualizado no Menu Unidades de Recebíveis em GTM.\r\nSeguem nossos atuais clientes cadastrados.\r\n\r\nCASA DO PAO DO FRANCES: 41621275000120\r\nCASA MAGALHAES: 07128945000132\r\nCASA VERDE: 33906277000137\r\nDANIEL FEIJO DE ALBUQUERQUE :18904443000172\r\nDROGARIA TORRES: 02302750000143\r\nMERCADINHO LADEIRA GRANDE: 10431453000126\r\nPANIFICADORA SOLIMOES LTDA: 07593684000121\r\n\r\n\r\n\r\nAtt.\r\n','',''),(82,'Boa tarde\nCom o foco de evitar confusão por parte dos clientes GTM, por gentileza, pedimos que ocultem na visão dos cliente em Minhas Vendas (Meio Captura) os itens disponíveis e somente deixem as opção TEF e PTE que são os equipamentos utilizados.\nImportante: por enquanto pedimos que ocultem, mas pode ser que no futuro precisa voltar alguma informação que ficou em oculto.\nSegue o print da tela na visão do Cliente.\nAtt.','',''),(83,'Boa tarde\nNão conseguimos agendar um relatório de Transações GTM, (ultrapassou as 5k linhas).\nFavor verificar o motivo do erro. Segue o print anexo.\nAtt.','',''),(84,'Boa tarde\nEstou tentando enviar o Convite de Optin e não está sendo enviado.\nPoderiam verificar o motivo?\nAtt','',''),(85,'Bom dia.\nFavor verificar o motivo da transação abaixo não ter gerado o corte de pagamento. Não aparece na lista dos Pagamentos débito realizados em Agosto.\nID da transação 42668\nAtt.','',''),(86,'Bom dia.\nPor gentileza, precisamos entender o motivo do tombamento do POS não ter dado certo. Não localizamos na AGT.\nCodigo ML0012\nNome Fantasia CIA DOS BRINQUEDOS\nRazão Social P E M DE MENEZES BRINQUEDOS\nCNPJ 36.278.170/0001-80\n\nFavor verificar com urgência.\nAtt.\n','',''),(87,'Boa tarde\r\nConforme e-mail enviado para Simone, favor verificar se é possível retirar a limitação de exportar até 5k linhas do relatório de transações, sem a necessidade de realizar o agendamento para as transações de GTM.\r\nAtt.','',''),(88,'Boa tarde\r\nSegue solicitação enviada por e-mail para Simone.\r\nFavor disponibilizar no FTP o Relatório Semanal para as transações de GTM (Precisamos  confirmar se transações com CBK/Cancelamento se são atualizadas nesse relatório também ou se precisamos extrair um relatório “a parte”)\r\nAtt','',''),(89,'Boa tarde\r\nConforme e-mail enviado para Simone, precisamos entender o seguinte ponto:\r\nNos cadastros realizados no portal, temos informado um MCC genérico. Em caso de necessidade de atualização. Como seria o processo para atualizar todos os cadastros para o MCC correspondente ao segmento do cliente? Esse processo é possível? É manual?\r\n\r\nAtt','',''),(90,'Boa tarde\r\nFavor incluir o e-mail carolinep@grupoboticario.com.br nos destinatários para recebimento dos e-mails de Optin de GTM.\r\nAtt.\r\n','',''),(91,'Boa tarde\r\nFavor verificar o motivo da transação abaixo não ter sido realizado o pagamento\r\nhttps://gtm.coadqboticario.com.br/portal/transacao/show/42668\r\nAtt.','',''),(92,'Bom dia.\r\nPor gentileza, Simone, conforme conversamos na reunião de estabilização CERC, o cliente Casa Verde está reclamando que não aparece para antecipar os valores de transações de crédito que tem com a Mooz.\r\nOntem eles liberaram a opção para antecipar junto a Rede, porém não aparecem os valores.\r\nIdentificamos que ha valores com status Atualizando. Poderia verificar se há algum problema, por gentileza?\r\n\r\nCodigo ML0009\r\nRazão Social CASA DO VERDE COMERCIO DE PRODUTOS NATURAIS LTDA\r\nNome CASA VERDE\r\nCNPJ 33.906.277/0001-37\r\n\r\nAtt','',''),(93,'Boa tarde\r\nHoje tentamos finalizar o Optin do cliente abaix, mas ocorreu erro (tela de erro em anexo).\r\nAcabamos finalizando manualmente no portal visão Adm.\r\nFavor criar a opção de logar como usuário, sem a necessidade de colocar login e senha.\r\n\r\nGrupo Franquia: 10012 - CP TIANA SALES\r\nCodigo: ML0013\r\nNome Fantasia: MIX DAS FRALDAS\r\nRazão Social: TIANA DE MENDONCA SALES\r\nNome: MIX DAS FRALDAS\r\nCNPJ: 24.841.364/0001-62\r\n\r\nAtt.','',''),(94,'Boa tarde\r\nPor gentileza, precisamos que seja corrigido a opção de exportar o relatório de loja, pois está ocorrendo erro.\r\nSegue o print abaixo.\r\n\r\nAtt','',''),(95,'Boa tarde\r\nPor gentileza, precisamos entender sobre cadastro dos clientes de GTM.\r\nAtualmente temos utilizado o MCC genérico (8999), porém já recebemos da Cielo NL para configurar no MCC correto.\r\nPorém ficamos em dúvida no seguinte ponto. Para o POS, somente transacionamos com a adquirente Rede e o MCC utilizado seria o genérico 8999. Mas se o cliente precisar dos dois equipamentos (PinPad e POS), conseguimos cadastrar os NLs das adquirentes, com ramo diferente?\r\n\r\nEm Mooz Cartões temos a opção da loja ter NL cadastrado para as duas adquirentes, porém o MCC sempre é o mesmo. No ponto que citamos, o POS ficaria configurado num MCC genérico e o PinPad seria num MCC de farmácia, por exemplo.\r\n\r\nPoderiam verificar?\r\n\r\nSegue Estabelecimentos criados pela Cielo.\r\n\r\nMCC	Estabelecimento	Lógico Tef	Rempac\r\n5912	2810556398	       41168228 9	072411133651\r\n7997	2810556380	       41168230 5	072411133651\r\n8999	2810556363	       41168231 3	072411133651\r\n5039	2810556355	       41168229 7	072411133651\r\n5411	2810556274	       41168216 4	072411133651\r\nAtt\r\n','',''),(96,'Boa tarde\r\nPor gentileza, precisamos confirmar se a Sysdata precisa realizar alguma configuração no Número lógico criado na Rede para transações de GTM.\r\nO NL abaixo será utilizado para venda por link\r\n210397086434705\r\n\r\nPoderiam verificar se há alguma ação da nossa parte, por gentileza?\r\nAtt.','',''),(97,'Boa tarde\r\nGostaríamos de confirmar uma informação quanto a alterações de taxas dos clientes GTM.\r\nConforme os prints abaixo, gostaria de confirmar se conseguimos ja criar as versões de taxas após período de Degustação (3 primeiros meses). Podemos deixar ja registrado as taxas que deverão valer após esse período?\r\nAtt.\r\n','',''),(98,'Boa tarde\r\nPor gentileza, a equipe de Pricing precisa de um relatório com a relação de clientes GTM com o faturamento realizado até o momento + as taxas aplicadas.\r\nSeria possível gerar um relatório nesse modelo?\r\nAtt. ','',''),(99,'Teste ','',''),(100,'Bom dia.\r\nSolicitamos a Cielo a criação de alguns NLs para começarmos a transacionar com a adquirente.\r\nRecebemos a confirmação que as informações das transações serão disponibilizadas no mesmo extrato que recebemos de Mooz Cartões.\r\nPrecisamos verificar se há algum problema em importar o mesmo extrato em Mooz Cartões e no portal GTM. Porém em GTM só iremos conciliar as transações de GTM mesmo.\r\nAtt.','',''),(101,'Boa tarde\r\nPor gentileza, a pedido da equipe de Compliance, precisamos saber se no relatório de Transações, existem mais campos disponíveis, porém não fica disponibilizado para visualização?\r\nSe sim poderiam informar quais os campos que conseguiriamos exportar para análises?\r\nPrecisamos da descrição de cada campo.\r\nAtt','',''),(102,'Boa tarde\r\nFavor incluir as taxas abaixo para Antecipação no Portal de GTM.\r\n\r\nAntecipação pontual: 0,79%\r\nAntecipação automática: 0,76%\r\nAtt.\r\n','',''),(103,'Boa tarde\r\nSegue solicitação realizada pelo José Lucas (Produtos)\r\n\r\nNo envio de comunicações via e-mail para clientes GTM, o endereço de e-mail remetente atual é: hagana-adquirencia@grupoboticario.com.br, e deve ser alterado para moozcartoesgb@somosmooz.com.br.\r\nAtt','',''),(104,'Boa tarde\nConforme solicitado pela Betina.\n\nFoi enviado para o Star dois arquivos de debito ref a GTM em duplicidade (em anexo), para pagamento em 30/09.\n\nPoderiam verificar o que ocorreu?\n\n \n\nObrigada\n\nAtt','',''),(105,'Bom dia\r\nPor gentileza, precisamos que verifiquem com urgência o erro que está ocorrendo ao concluir o Optin.\r\nCliente não conseguiu finalizar, pois ocorre tela de erro ao concluir o cadastro dos dados bancários.\r\nComo precisamos pagar a cliente, acabamos fazendo o processo manualmente, porém precisamos da correção.\r\nSegue print da tela de erro.\r\n\r\nErro ocorreu com cliente\r\nCodigo: ML0017\r\nNome Fantasia: PAPELARIA POPULAR\r\nRazão Social: ERONIZA FERREIRA DE SOUSA\r\nCNPJ: 15.313.452/0001-09\r\n[104] CAIXA ECONOMICA FEDERAL - AG.: 4378 CC: 271-4\r\nAtt','',''),(106,'Boa tarde\r\nPor gentileza, seria possível incluir no relatório de transações o tipo de equipamento?\r\nTEF\r\nPOS\r\nWEB\r\nECOMM\r\nPOS_SITEF\r\nMTEF\r\nOMNI\r\n\r\nAtt','',''),(107,'Boa tarde\r\nidentificamos que os cadastros dos clientes abaixo, não estão disponíveis no AGT e com isso não geraram a chave de ativação.\r\n\r\nZé Bebidas\r\nToca das Bebidas\r\nSanta Breja\r\n\r\nFavor verificar.\r\nAtt. ','',''),(108,'Bom dia.\nTivemos pagamentos em duplicidades no dia 30/09 em GTM, no montante de 6,8k. \nConforme acordado com Simone, gentileza, providenciar o abatimento desses valores em títulos futuros.\nFavor nos retornar quais foram os títulos que serão descontados, para que possamos informar aos clientes.\n\nSegue em anexo a listagem com os valores e os clientes.\n\nImportante: Precisamos que seja contabilizado a aplicação desses descontos dentro do mês de Outubro (período contábil).\nAtt.','',''),(109,'Bom dia,\nPor gentileza, precisamos que seja atualizado o portal na visão de todos os clientes a informação de Saldo para Antecipar, na tela inicial.\nConforme os prints anexo, o valor encontra-se zerado, mas ao consultar o menu de Antecipação consta o valor disponível.\nComo exemplo, segue o CP 10005 - Daniel Albuquerque.\nAtt.','','');
