INSERT INTO `mantis_bugnote_text_table` VALUES (20,''),(21,'Bom dia, Caroline.\r\n\r\nAs outras opções de filtro estão disponíveis logo abaixo de \"Todos\". Apesar de estarem \"camufladas\", as outras opções de filtro estão disponíveis e aparecem se você passar o mouse pelas outras opções, seria isso?\r\nOu você deseja remover todas as outras opções de filtro, deixando somente a POS?'),(22,'Boa tarde\r\n\r\nJá foram todos cadastrados. Poderia verificar?'),(23,'Deu Certo Paulo. Muito obrigada. Irei finalizar o Mantis.\r\nSó poderia adicionar a informação do que foi realizado para corrigir?\r\nAtt.'),(24,'Boa tarde, Caroline.\n\nAjustei as cores das opções disponíveis, agora elas ficam visíveis na tela do cliente.\nPoderia verificar se isso atende como solução? \nAbs'),(25,'Boa tarde, Caroline.\n\nAs opções de filtragem foram expandidas até o ano de 2025.'),(26,'Muito obrigada Paulo.\r\nConferido no acesso do cliente e está ok.'),(27,'Obrigada'),(28,'Muito obrigada pela correção Paulo.\r\nConferido e está ok.'),(29,'Boa noite, Caroline.\r\n\r\nO sistema já está gerando os relatórios normalmente.\r\nPoderia confirmar?\r\n\r\nAbs'),(30,'Boa noite, Caroline.\r\n\r\nJá subi uma correção para o processo de OptIn, podes me confirmar se está funcionando?'),(31,'Boa noite, Caroline.\r\n\r\nEstou trabalhando numa correção para este problema de login na tela da CP.\r\nRessalto que para a opção de Login aparecer, o OptIn precisa estar finalizado e a Solicitação de OptIn precisa constar como Aprovada, pois somente nesse caso será criado o usuário de acesso à interface web.\r\n\r\nVerifiquei que, exclusivamente no caso da CP SILVA JUNIOR, o status do OptIn consta como \"Enviado\", somente, não constando como Aprovado, apesar desta CP já possuir um Usuário Web para acesso.\r\n\r\nSabes me informar se, para o caso dele, a Solicitação de OptIn foi Aprovada? Posso prosseguir com a conclusão do OptIn desta CP, uma vez que a CP já consta com um usuário web?'),(32,'Bom dia, Caroline.\r\n\r\nNão consegui encontrar este problema por aqui, poderia me referenciar uma conta onde isso esteja acontecendo?'),(34,'Bom dia Paulo.\r\nPara o CP Silva Junior, o Roberto precisou criar o usuário, pois ao efetuar o Optin, cadastro dos dados bancários, o Portal apareceu uma mensagem de erro e não foi possível concluir o cadastro no processo normal.\r\nE como precisavamos liberar o acesso ao portal, foi criado o usuário de forma diferente.\r\nAtt.'),(35,'Paulo, bom dia. Iremos acompanhar, pois temos 4 clientes que precisarão fazer o Optin. Assim que tivermos o ok, informamos.'),(36,'Deu certo Paulo. Muito obrigada pela correção'),(37,'Muito obrigada'),(38,'O numero de contato foi atualizado.'),(39,'Muito obrigada pela atualização Paulo. Posso pedir mais um favor.\r\nMudar de Central de atendimento ao Franqueado, para Central de atendimento ao Cliente.\r\n\r\nAtt'),(40,'Boa tarde, Caroline.\r\n\r\nJá corrigi as transações dessa planilha correspondente à Drogaria Torres, entrarão no próximo fluxo do CAP.\r\nDuas transações da Planilha estão sem loja, estarei recuperando os arquivos originais para identificar a loja de origem e estar incluindo elas no próximo fluxo, também.'),(41,'Boa tarde, Caroline.\r\n\r\nO segundo texto também já foi alterado.'),(42,'Bom dia, Caroline.\r\nJá subi uma correção que deve estar entrando em Produção de hoje para amanhã'),(43,'Boa tarde, Caroline.\r\n\r\nAs duas últimas transações da planilha correspondem à Transações do Mooz Cartões, e já foram pagas. Elas não correspondem à transações do GTM.'),(44,'Bom dia.\r\nPrecisamos de um retorno referente o acesso no perfil dos clientes GTM.\r\nAtt'),(45,'Boa tarde, Caroline.\r\n\r\nPoderia verificar novamente?\r\nAlguns clientes ainda não possuem o botão de login na listagem pois, como foi explicado, o processo de OptIn deles ainda não foi finalizado.'),(46,'Bom dia Paulo. \r\nAcessei como teste alguns cliente e deu certo logar na visão Cliente.\r\nSomente do CP Torres permanece com erro. Poderia verificar, por gentileza?\r\nAtt.'),(47,'Tivemos problemas no tombamento de dois clientes\r\nSegue o outro\r\nNome Fantasia MIX DAS FRALDAS\r\nRazão Social TIANA DE MENDONCA SALES\r\nCNPJ 24.841.364/0001-62\r\nAtt'),(48,'Ainda não consta a atualização no Portal GTM. Poderiam verificar, por gentileza.\r\nPelo que consultamos, na CERC está atualizando, mas no portal não reflete a informação.\r\nAtt'),(49,'Boa tarde\r\nIdentificamos a correção do tombamento do POS para os clientes acima. Mas gostariamos de confirmar se foi uma correção definitiva.\r\nAtt.'),(50,'Vou fechar caso, pois identificamos que o código está aparecendo no cadastro'),(51,'Pelo que identifiquei esse erro foi corrigido. Estou finalizando o mantis.'),(52,'Foi possível o envio do Optin hoje, 24/08'),(53,'Olá Caroline, poderia fechar este MANTIS se estiver de acordo com a resposta, por favor.'),(54,'@caroline,\r\npoderia confirmar se vc conseguiu acessar o Minhas Vendas?'),(55,'Bom dia Caroline.\r\n\r\nFiz a correção do acesso, poderia verificar novamente?'),(56,'Bom dia Caroline.\r\n\r\nAs colunas já foram incluídas. Poderia verificar?'),(57,'Bom dia, Caroline.\r\n\r\nEstávamos com alguns problemas no servidor de e-mail que estava impossibilitando o disparo de e-mails a partir do GTM, mas que já foi corrigido, os e-mails já estão sendo disparados normalmente.'),(58,'Bom dia Caroline.\r\n\r\nA demanda seria para ocultar o \"Valor da Mensalidade\" para uma unica CP? Ou para todas? Qual seria o critério para ocultar o campo?'),(59,'Paulo,\r\nBoa tarde.\r\nNesse momento seria para um CP específico. Mas se puderem avaliar para outros também. Pois pode acontecer de querermos ocultar para mais de um CP.\r\nAtt.'),(60,'Muito obrigada pela informação.\r\nVamos finalizar o Mantis'),(61,'obrigada.'),(62,'Foram incluídas. Muito obrigada.'),(63,'Obrigada.'),(64,'Deu certo Paulo. Muito obrigada'),(65,'Boa tarde, Caroline\r\n\r\nA opção de alteração de MCC só pode ser realizada via re-importação do arquivo de credenciamento da loja, mantendo as mesmas informações que já estão cadastradas no GTM, mudando apenas o MCC desejado.\r\nA modificação do MCC não é recomendado, entretanto, uma vez que outras configurações, como o Roteamento da loja, são informações criadas a partir do MCC cadastrado.\r\nAinda não temos uma visibilidade mapeada de todos os pontos de impacto de uma possível alteração do MCC de uma loja.'),(66,'Bom dia, Caroline.\r\n\r\nJa foi subida uma correção para isso. Poderia verificar?'),(67,'Boa tarde,\n\nAs URs estao atualizadas e devidamente cadastradas no CERC'),(68,'Exportacao do relatorio corrigido'),(69,'Corrigimos o optin, favor validar'),(70,'Email adicionado ao template'),(71,'Foi feito o corte da UR, o problema q ocasionou o nao pagamento foi que na data de corte ainda nao tinhas sido definido os dados bancarios para pagamento, Por enquanto ainda nao ha o tratamento automatico das URs depois do cadastro de dados bancarios.'),(72,'Muito obrigada pela correção Oscar.'),(73,'Mantis não respondido, mas vimos que foi corrigido o ICTP'),(74,'Boa tarde\r\nPrecisamos de um retorno sobre esse Mantis.\r\nAtt.'),(75,'Boa tarde, ainda não estamos conseguindo agendar os relatórios em GTM - Operações > Transações.\r\nAtt.'),(76,'Muito obrigada pela informação'),(77,'Favor informar quando será realizada a atualização automática das URs em GTM\r\nAtt.'),(78,'Corte realizado'),(79,'Boa tarde!\n\nCriadas duas novas faixas para o GTM:\nFAIXA F - 0,79%\nAuto F - 0,76%\n\nAs demais faixas foram mantidas.'),(80,'Boa tarde\r\nConseguem nos ajudar?\r\nAtt.'),(81,'Bom dia, Caroline!\r\nA utilização de MCCs diferentes para o mesmo CNPJ não é possível. \r\nObserve que o MCC está atrelado ao CNAE/CNPJ, ou seja, os adquirentes não permitem \"n\" MCCs para o mesmo CNPJ. A relação MCC/CNPJ é sempre um para um.'),(82,'Bom dia!\r\nSim, podemos cadastrar as taxas  \"degustação\" no portal GTM com data de início e fim.\r\nAo enviar o e-mail de cadastro, você pode informar os períodos de vigência de cada taxa para que possamos cadastrar e configurar as datas.'),(83,'Boa tarde\r\nPrecisamos de um retorno sobre esse Mantis.\r\nAtt'),(84,'Bom dia!\n\no problema foi identificado, resolvido e o arquivo reenviado.\nTodas as lojas estão ok\n\n\n\nProblema:\nNosso entendimento era que somente a linha com erro fosse recusada pela SWE, mas pela análise não é isso que acontece.\nSe somente uma linha estiver com erro e as demais ok, o arquivo é 100% recusado. \nAjustamos nosso processo e validamos com a SWE o entendimento.'),(85,'Bom dia\nSi, conforme informado no whats, estamos com mais um cliente com problema ao fazer o Optin.\nGrupo Franquia: 10020 - CP EDIVANIA ALVES\nCodigo: ML0021\nNome Fantasia: DROGARIA RIVEPE\nRazão Social: EDIVANIA RIBEIRO DA SILVA ALVES\n\nPrecisamos entender o erro e corrigir o quanto antes, pois está impactando no cadastro dos mesmos.\nDo cliente acima, precisei fazer manualmente. Mas precisamos da correção total, por gentileza.\nAtt.'),(86,'Boa tarde!\ncampo tipo de equipamento incluído no relatório.'),(87,'Mais um cliente com problema no Optin\r\nCodigo:ML0020\r\nNome Fantasia : DESTAK DISTRIBUIDORA\r\nRazão Social :T ALEXANDRE GONCALVES\r\nNome: DESTAK DISTRIBUIDORA\r\n\r\nFavor verificar\r\nAtt.'),(88,'Bom dia!\r\n\r\nProblema identificado: dois serviços de OPTIN com o mesmo nome: OPTIN - entrada de franquias e OPTIN CERC.\r\n\r\nCorreção: Alterar os nomes dos serviços. Nomes alterados e ambiente produção atualizado.'),(89,'Boa tarde!\r\nO erro já foi corrigido, os e-mails mais recentes já estão indo com o link correto.\r\n\r\nAtt.'),(90,'Boa tarde!\r\nO endereço de e-mail já foi alterado e até o próximo dia entrará em produção.\r\n\r\nAtt.,');
/*!40000 ALTER TABLE `mantis_bugnote_text_table` ENABLE KEYS */;
UNLOCK TABLES;

